import React, { useState, useEffect } from 'react';
import axios from 'axios';
import ReactMapGL from 'react-map-gl';

const AddressMap = () => {
    const [viewport, setViewport] = React.useState({
        latitude: 37.7577,
        longitude: -122.4376,
        zoom: 8
    });

    const [address, setAddress] = useState('')
    const dataAddress = [
        { id: 1, addresss: "Số 1 Thái Hà, Đống Đa, Hà Nội" },
        { id: 2, addresss: "2A Trần Đại Nghĩa, Quận Hai Bà Trưng, Hà Nội" },
        { id: 3, addresss: "364 Ngô Gia Tự, thành phố Bắc Ninh" },
    ];
    return (
        <div className="modal fade" id="exampleModalCenter" tabIndex={-1} role="dialog" aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
            <div className="modal-dialog modal-dialog" style={{ maxWidth: '75%', marginTop: '70px' }} role="document">
                <div className="modal-content">
                    <div className="modal-body">
                        <div className="col-md-12">
                            <div className="row">
                                <div className="col-md-6">
                                    <div class="modal-header">
                                        <h5 className="modal-title" id="exampleModalLongTitle">Cửa Hàng</h5>
                                    </div>
                                    <div id="pb-select-location-list" className="pb-select-location-list">
                                        <div className="pb-select-location-item">
                                            <div>
                                                <img src="https://sdk-vn.pushdi.com/image/maxlead/widget_icon_building.svg" />
                                                <span>Phong Vũ Trần Đại Nghĩa</span>
                                            </div>
                                            <div>
                                                <img src="https://sdk-vn.pushdi.com/image/maxlead/widget_icon_location.svg" />
                                                <span>2A Trần Đại Nghĩa, Quận Hai Bà Trưng, Hà Nội</span>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="col-md-6">
                                    <ReactMapGL
                                        {...viewport}
                                        width="467px"
                                        height="450px"
                                        onViewportChange={(viewport) => setViewport(viewport)}
                                        mapboxApiAccessToken="pk.eyJ1IjoidGhhbmgwMDciLCJhIjoiY2t3bTN0M21qMjhkdDJ2dXR4eHliZW9rdSJ9.g0QyW0VbyWuHzQdmomiZ1w"
                                    />
                                    {/* <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d125802.44188694225!2d105.74666080365661!3d9.822936906086232!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31a05f23f51a7a71%3A0x3ee1e426e38fa80a!2zVHguIE5nw6MgQuG6o3ksIEjhuq11IEdpYW5nLCBWaeG7h3QgTmFt!5e0!3m2!1svi!2s!4v1638248419382!5m2!1svi!2s" width={467} height={450} style={{ border: 0 }} allowFullScreen loading="lazy" /> */}
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AddressMap;
